  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import '../../styles/scss/theme.scss';
import t from '../../i18n';
import { PropsTable, Playground } from 'docz'
import Checkbox from '../src';
import styled from 'styled-components';

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"checkbox"}}><MDXTag name="strong" components={components} parentName="h1">{`Checkbox`}</MDXTag></MDXTag>

<PropsTable of={Checkbox} />
<Playground __codesandbox={`undefined`} __position={1} __code={`<Checkbox />
<Checkbox disabled />
<Checkbox text="Texto" />
<Checkbox disabled text="Desabilitado" />`} __scope={{props: this ? this.props : props,t,Checkbox,styled}}>
  <Checkbox />
  <Checkbox disabled />
  <Checkbox text="Texto"/>
  <Checkbox disabled text="Desabilitado"/>
</Playground>
           </MDXTag>
  }
}
